import time
class Solution:
    def lengthOfLongestSubstring(self, string: str) -> int:
        #Code for this

        longestStr = 0
        currentString = ""
        length = 0
        #print("length of string", len(string))

        if len(string) < 2:
            return len(string)
        elif len(string) <= 2:
            if string[0] == string[1]:
                return 1
            else:
                return 2
        
        stringSet = set()
        totalSet = set()
        size = len(string)
        for i in range(size):
            for j in range(i, size):
                if string[j] not in stringSet:
                    currentString = currentString + string[j]
                    stringSet.add(string[j])
                    length += 1
                else:
                    if length > longestStr:
                        print(currentString)
                        longestStr = length
                    elif currentString in totalSet:
                        break
                    else:
                        totalSet.add(currentString)
                    stringSet.clear()
                    stringSet.add(string[j])
                    currentString = string[j]
                    length = 1

            if length > longestStr:
                longestStr = length
            stringSet.clear()
            currentString = ""
            length = 0

        return longestStr


